(318, 1, '2017-06-24 23:26:46', '2017-06-24 20:26:46', '[video width=\"1152\" height=\"720\" mp4=\"http://dimitriosvergados.eu/girasoleshop/wp-content/uploads/2017/06/GIRASOLE-NAFPLIO-ΑΤΕΛΙΕ-ΠΑΙΔΙΚΗΣ-ΜΟΔΑΣ.mp4\"][/video]\r\n\r\n&nbsp;\r\n\r\nGirasole is a handmade clothing, crafts and toys business based in Nafplio. Our mission is to create interesting and exciting things for our customers.\r\n\r\nYou may want to ask…why the name?! Well, the sunflowers are beautiful and bright like the morning sunshine; so Sunflowers hold a special place in our hearts. No idea why it is in Italian, though.', 'This is us', '', 'inherit', 'closed', 'closed', '', '282-revision-v1', '', '', '2017-06-24 23:26:46', '2017-06-24 20:26:46', '', 282, 'http://dimitriosvergados.eu/girasoleshop/index.php/2017/06/24/282-revision-v1/', 0, 'revision', '', 0),
